-- ----------------------------
-- Procedure structure for `GSP_GR_EfficacyUserID`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GSP_GR_EfficacyUserID`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GSP_GR_EfficacyUserID`(dwUserID INT,								-- 用户 I D
	strPassword NCHAR(32),						-- 用户密码
	strClientIP NVARCHAR(15),					-- 连接地址
	strMachineID NVARCHAR(32),					-- 机器标识
	wKindID SMALLINT,							-- 游戏 I D
	wServerID SMALLINT,						-- 房间 I D
	OUT strErrorDescribe NVARCHAR(127),		-- 输出信息
	OUT nRet INT)
label_pro:BEGIN

	-- 基本信息
	DECLARE nUserID INT;
	DECLARE nFaceID SMALLINT;
	DECLARE nCustomID INT;
	DECLARE strNickName NVARCHAR(31);
	DECLARE strUnderWrite NVARCHAR(63);

	-- 扩展信息
	DECLARE nUserRight INT;
	DECLARE nGender TINYINT;
	DECLARE nMemberOrder SMALLINT;

	-- 积分变量
	DECLARE nScore BIGINT;
	DECLARE nDiamond BIGINT;
	DECLARE nInsure BIGINT;
	DECLARE nWinCount INT;
	DECLARE nLostCount INT;
	DECLARE nDrawCount INT;
	DECLARE nFleeCount INT;
	DECLARE nUserMedal INT;
	DECLARE nExperience INT;
	DECLARE nLoveLiness INT;
	DECLARE nPlayTimeCount INT;
	DECLARE nOnLineTimeCount INT;

	-- 辅助变量
	DECLARE nEnjoinLogon INT;

	-- 查询用户
	DECLARE cbNullity BIT;
	DECLARE cbStunDown BIT;
	DECLARE strLogonPass NCHAR(32);
	DECLARE	strStoreMachineID NVARCHAR(32);
	DECLARE strMoorMachine TINYINT;
	DECLARE nAndroid INT;
	DECLARE nBenefitTimes INT;
	DECLARE dtLastBenefitTime timestamp;

	-- 游戏信息
	DECLARE nAllLogonTimes INT;
	DECLARE nGameUserRight INT;
	DECLARE nGameMasterRight INT;
	DECLARE nGameMasterOrder SMALLINT;
	
	-- 查询锁定
	DECLARE nLockKindID INT;
	DECLARE nLockServerID INT;
	
	-- 查询信息
	DECLARE strKindName NVARCHAR(31);
	DECLARE strServerName NVARCHAR(31);
			
	-- 记录标识
	DECLARE nInoutIndex BIGINT;

	-- 登录统计
	DECLARE nDateID INT;
	
	-- 查询用户
	SELECT UserID, NickName, UnderWrite, LogonPass,FaceID, CustomID,Gender, Nullity, StunDown, 
	Experience, LoveLiness, UserRight, MemberOrder, MoorMachine, isAndroid, LastLogonMachine, BenefitTimes, LastBenefitTime, Diamond,
	PlayTimeCount,OnLineTimeCount
	INTO nUserID,strNickName,strUnderWrite,strLogonPass,nFaceID,nCustomID,nGender,cbNullity,cbStunDown,nExperience,
	nLoveLiness,nUserRight, nMemberOrder, strMoorMachine, nAndroid, strStoreMachineID, nBenefitTimes,dtLastBenefitTime, nDiamond,
	nPlayTimeCount,nOnLineTimeCount
	FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID;

	-- 查询用户
	IF nUserID IS NULL THEN
		SET strErrorDescribe='您的帐号不存在或者密码输入有误，请查证后再次尝试登录！';
		SET nRet = 1;
		leave label_pro;
	END	IF;

	-- 帐号禁止
	IF cbNullity<>0 THEN
		SET strErrorDescribe='您的帐号暂时处于冻结状态，请联系客户服务中心了解详细情况！';
		SET nRet = 2;
		leave label_pro;
	END IF;

	-- 帐号关闭
	IF cbStunDown<>0 THEN
		SET strErrorDescribe='您的帐号使用了安全关闭功能，必须重新开通后才能继续使用！';
		SET nRet = 2;
		leave label_pro;
	END	IF;
	
	-- 固定机器
	IF strMoorMachine=1 THEN
		IF strStoreMachineID<>strMachineID THEN
			SET strErrorDescribe='您的帐号使用固定机器登录功能，您现所使用的机器不是所指定的机器！';
			SET nRet = 2;
			leave label_pro;
		END IF;
	END IF;

	-- 密码判断
	IF strLogonPass<>strPassword THEN-- AND strClientIP<>N'0.0.0.0'
		SET strErrorDescribe='抱歉,由于您的帐号在其它地方登录导致验证令牌被重置,请重新登录平台后再次尝试！';
		SET nRet = 3;
		leave label_pro;
	END IF;

	-- 固定机器
	IF strMoorMachine=2 THEN
		SET strMoorMachine=1;
		SET strErrorDescribe='您的帐号成功使用了固定机器登录功能！';
		UPDATE QPAccountsDB.AccountsInfo SET MoorMachine=strMoorMachine, LastLogonMachine=strMachineID WHERE UserID=nUserID;
	END IF;

	-- 开始事务
	start transaction;

	-- 救济金
	IF 	DATEDIFF(dtLastBenefitTime,NOW()) <> 0 THEN
		set nBenefitTimes = 0;
		UPDATE QPAccountsDB.AccountsInfo SET BenefitTimes=nBenefitTimes WHERE UserID=nUserID;
	END IF;

	-- 游戏信息
	SELECT Score, InsureScore, WinCount, LostCount, DrawCount, DrawCount,	FleeCount, UserRight, MasterRight, MasterOrder, AllLogonTimes INTO 
	nScore,nInsure,nWinCount,nLostCount,nDrawCount,nDrawCount,nFleeCount,nGameUserRight,nGameMasterRight,nGameMasterOrder,nAllLogonTimes
	FROM GameScoreInfo WHERE UserID=dwUserID;

	-- 信息判断
	IF nScore IS NULL THEN
		-- 插入资料
		VALUES (dwUserID, strClientIP, strMachineID, strClientIP, strMachineID);

		-- 游戏信息
		SELECT Score, InsureScore, WinCount, LostCount, DrawCount, DrawCount,	FleeCount, UserRight, MasterRight, MasterOrder, AllLogonTimes INTO 
		nScore,nInsure,nWinCount,nLostCount,nDrawCount,nDrawCount,nFleeCount,nGameUserRight,nGameMasterRight,nGameMasterOrder,nAllLogonTimes
		FROM GameScoreInfo WHERE UserID=dwUserID;
	END IF;

	-- 异常判断
	IF nScore<0 THEN
		-- 结束事务
		ROLLBACK;
		start transaction;

		-- 错误信息
		SET strErrorDescribe='抱歉地通知你，您的游戏币数据出现了异常情况，请联系客户服务中心了解详细情况！';
		SET nRet = 14;
		leave label_pro;
	END IF;

	-- 查询锁定
	IF strClientIP<>'0.0.0.0' THEN
		-- 锁定解除
		DELETE FROM GameScoreLocker WHERE UserID=dwUserID AND ServerID=wServerID;

		-- 查询锁定
		SELECT KindID, ServerID INTO nLockKindID,nLockServerID FROM GameScoreLocker WHERE UserID=dwUserID;

		-- 锁定判断
		IF nLockKindID IS NOT NULL AND nLockServerID IS NOT NULL THEN
			-- 结束事务
			ROLLBACK;
			start transaction;

			-- 查询类型
			IF nLockKindID<>0 THEN
				-- 查询信息
				SELECT GameName INTO strKindName FROM QPPlatformDB.GameItem WHERE GameID=nLockKindID;
				SELECT ServerName INTO strServerName FROM QPPlatformDB.GameRoomInfo WHERE ServerID=nLockServerID;

				-- 错误信息
				IF strKindName IS NULL THEN
					SET strKindName='未知游戏';
				END IF;
				IF strServerName IS NULL THEN
					SET strServerName='未知房间';
				END IF;
				SET strErrorDescribe=concat('您正在 [ ', strKindName, ' ] 的 [ ', strServerName, ' ] 游戏房间中，不能同时在进入此游戏房间！');
				SET nRet = 4;
				leave label_pro;
			ELSE
				-- 提示消息
				SELECT ErrorDescribe='您正在进行保险柜处理过程中，暂时无法进入此游戏房间！';
				SET nRet = 4;
				leave label_pro;
			END IF;
		END IF;
	END IF;
	
	-- 权限标志
	SET nUserRight=nUserRight|nGameUserRight;
	SET nUserRight=nUserRight&~256;

	-- 进入记录
	INSERT RecordUserInout (UserID, EnterScore, EnterDiamond, EnterInsure, EnterLoveliness, KindID, ServerID, EnterClientIP, EnterMachine)
	VALUES (nUserID, nScore, nDiamond, nInsure, nLoveLiness, wKindID, wServerID, strClientIP, strMachineID);

	-- 记录标识
	SET nInoutIndex=LAST_INSERT_ID();

	-- 插入锁表
	IF strClientIP<>'0.0.0.0' THEN
		-- 插入锁表
		INSERT GameScoreLocker (UserID, ServerID, KindID, EnterID, EnterIP, EnterMachine) VALUES (dwUserID, wServerID, wKindID, nInoutIndex, strClientIP, strMachineID);
		IF @error<>0 THEN
			-- 结束事务
			ROLLBACK;
			start transaction;

			-- 错误信息
			SET strErrorDescribe='抱歉地通知你，游戏币锁定操作失败，请联系客户服务中心了解详细情况！';
			SET nRet = 14;
			leave label_pro;
		END IF;
	END IF;

	-- 更新信息
	UPDATE GameScoreInfo SET AllLogonTimes=AllLogonTimes+1, LastLogonDate=NOW(), 
		LastLogonIP=strClientIP,LastLogonMachine=strMachineID WHERE UserID=dwUserID;

	-- 登录统计
	SET nDateID=UNIX_TIMESTAMP(NOW());

	-- 插入记录
	IF nAllLogonTimes>0 THEN
		UPDATE SystemStreamInfo SET LogonCount=LogonCount+1 WHERE DateID=nDateID AND KindID=wKindID AND ServerID=wServerID;
		IF ROW_COUNT()=0 THEN
			INSERT SystemStreamInfo (DateID, KindID, ServerID, LogonCount) VALUES (nDateID, wKindID, wServerID, 1);
		END IF;
	ELSE
		UPDATE SystemStreamInfo SET RegisterCount=RegisterCount+1 WHERE DateID=nDateID AND KindID=wKindID AND ServerID=wServerID;
		IF ROW_COUNT()=0 THEN
			INSERT SystemStreamInfo (DateID, KindID, ServerID, RegisterCount) VALUES (nDateID, wKindID, wServerID, 1);
		END IF;
	END IF;

	-- 结束事务
	commit;

	-- 输出变量
	SELECT nUserID AS UserID, strNickName AS NickName, strUnderWrite AS UnderWrite,  nFaceID AS FaceID,
		nCustomID AS CustomID, nGender AS Gender, nUserRight AS UserRight,nDiamond as Diamond,
		nMemberOrder AS MemberOrder, nScore AS Score,  nDiamond AS Diamond, nInsure AS Insure, nWinCount AS WinCount,
		nLostCount AS LostCount, nDrawCount AS DrawCount, nFleeCount AS FleeCount,nExperience AS Experience, nLoveLiness AS LoveLiness,
		nPlayTimeCount AS PlayTimeCount, nOnLineTimeCount AS OnLineTimeCount,
		nInoutIndex AS InoutIndex, nAndroid AS isAndroid, nBenefitTimes AS BenefitTimes, dtLastBenefitTime AS LastBenefitTime;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GSP_GR_LeaveGameServer`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GSP_GR_LeaveGameServer`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GSP_GR_LeaveGameServer`(dwUserID INT,								-- 用户 I D
	dwOnLineTimeCount INT,						-- 在线时间

	-- 系统信息
	dwInoutIndex INT,							-- 进出索引
	dwLeaveReason INT,							-- 离开原因

	-- 记录成绩
	lRecordScore BIGINT,						-- 用户分数
	lRecordGrade BIGINT,						-- 用户成绩
	lRecordInsure BIGINT,						-- 用户银行
	lRecordRevenue BIGINT,						-- 游戏税收
	lRecordWinCount INT,						-- 胜利盘数
	lRecordLostCount INT,						-- 失败盘数
	lRecordDrawCount INT,						-- 和局盘数
	lRecordFleeCount INT,						-- 断线数目
	lRecordUserMedal INT,						-- 用户奖牌
	lRecordExperience INT,						-- 用户经验
	lRecordLoveLiness INT,						-- 用户魅力
	dwRecordPlayTimeCount INT,					-- 游戏时间

	-- 变更成绩
	lVariationScore BIGINT,					-- 用户分数
	lVariationGrade BIGINT,					-- 用户成绩
	lVariationInsure BIGINT,					-- 用户银行
	lVariationRevenue BIGINT,					-- 游戏税收
	lVariationWinCount INT,					-- 胜利盘数
	lVariationLostCount INT,					-- 失败盘数
	lVariationDrawCount INT,					-- 和局盘数
	lVariationFleeCount INT,					-- 断线数目
	lVariationUserMedal INT,					-- 用户奖牌
	lVariationExperience INT,					-- 用户经验
	lVariationLoveLiness INT,					-- 用户魅力
	dwVariationPlayTimeCount INT,				-- 游戏时间

	-- 属性信息
	wKindID INT,								-- 游戏 I D
	wServerID INT,								-- 房间 I D
	strClientIP NVARCHAR(15),					-- 连接地址
	strMachineSerial NVARCHAR(32))
BEGIN
	DECLARE DateID	INT;

	SET DateID = UNIX_TIMESTAMP(NOW());

	-- 开始事务
	start transaction;

	-- 用户积分
	UPDATE GameScoreInfo SET Score=Score+lVariationScore, InsureScore=InsureScore+lVariationInsure, Revenue=Revenue+lVariationRevenue,
		WinCount=WinCount+lVariationWinCount, LostCount=LostCount+lVariationLostCount, DrawCount=DrawCount+lVariationDrawCount,
		FleeCount=FleeCount+lVariationFleeCount, PlayTimeCount=PlayTimeCount+dwVariationPlayTimeCount, OnLineTimeCount=OnLineTimeCount+dwOnLineTimeCount
	WHERE UserID=dwUserID;

	-- 存在判断
	IF NOT EXISTS(SELECT * FROM StreamScoreInfo WHERE DateID=DateID AND UserID=dwUserID) THEN
		-- 插入记录
		VALUES(DateID, dwUserID, lVariationWinCount, lVariationLostCount, lVariationRevenue, dwVariationPlayTimeCount, dwOnLineTimeCount, NOW(), NOW());
	ELSE
		-- 更新记录
		UPDATE StreamScoreInfo SET WinCount=WinCount+lVariationWinCount, LostCount=LostCount+lVariationLostCount, Revenue=Revenue+lVariationRevenue,
			   PlayTimeCount=PlayTimeCount+dwVariationPlayTimeCount, OnLineTimeCount=OnLineTimeCount+dwOnLineTimeCount, LastCollectDate=NOW()
		WHERE DateID=DateID AND UserID=dwUserID;
	END IF;

	-- 锁定解除
	DELETE FROM GameScoreLocker WHERE UserID=dwUserID AND ServerID=wServerID;

	-- 机器人不记录税收
	IF strClientIP='0.0.0.0' THEN
		SET lRecordRevenue=0;
	END IF;

	-- 离开记录
	UPDATE RecordUserInout SET LeaveTime=NOW(), LeaveReason=dwLeaveReason, LeaveMachine=strMachineSerial,LeaveClientIP=strClientIP,
		Score=lRecordScore, Grade=lRecordGrade, Insure=lRecordInsure, Revenue=lRecordRevenue, WinCount=lRecordWinCount, LostCount=lRecordLostCount,
		DrawCount=lRecordDrawCount, FleeCount=lRecordFleeCount, Experience=lRecordExperience, LoveLiness=lRecordLoveLiness,
		PlayTimeCount=dwRecordPlayTimeCount, OnLineTimeCount=dwOnLineTimeCount
	WHERE ID=dwInoutIndex AND UserID=dwUserID;

	-- 结束事务
	commit;

	-- 全局信息
	UPDATE QPAccountsDB.AccountsInfo SET Experience=Experience+lVariationExperience, LoveLiness=LoveLiness+lVariationLoveLiness,
		PlayTimeCount=PlayTimeCount+dwRecordPlayTimeCount,OnLineTimeCount=OnLineTimeCount+dwOnLineTimeCount
	WHERE UserID=dwUserID;

END
;;
DELIMITER ;

