-- ----------------------------
-- Procedure structure for `GSP_GR_UserMatchFee`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GSP_GR_UserMatchFee`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GSP_GR_UserMatchFee`(dwUserID INT,								-- 用户 I D
	lMatchFee BIGINT,							-- 报名费用
	wKindID INT,								-- 游戏 I D
	wServerID INT,								-- 房间 I D
	strClientIP NVARCHAR(15),					-- 连接地址
	dwMatchID	INT,							-- 比赛 I D
	dwMatchNo	INT,							-- 比赛场次
	strMachineID NVARCHAR(32),					-- 机器标识
	OUT strErrorDescribe NVARCHAR(127),		-- 输出信息
	OUT nRet INT)
label_pro:BEGIN	
	-- 比赛信息
	DECLARE cbMatchFeeType TINYINT;
	DECLARE cbMemberOrder TINYINT;
	DECLARE InitialScore BIGINT;
	
	-- 用户信息
	DECLARE IsAndroidUser TINYINT;
	DECLARE UserMemberOrder TINYINT;

	-- 查询金币
	DECLARE Score BIGINT;

	-- 查询元宝
	DECLARE wUserMedal BIGINT;
	
	-- 查询金币
	DECLARE CurrScore BIGINT;
	
	-- 查询元宝
	DECLARE CurrIngot BIGINT;
	
	SELECT cbMemberOrder=a.MemberOrder,cbMatchFeeType=a.MatchFeeType,InitialScore=b.InitialScore FROM qpplatformdb.MatchPublic a,qpplatformdb.MatchImmediate b
	WHERE a.MatchID=dwMatchID AND a.MatchID=b.MatchID;
	IF cbMemberOrder IS NULL OR cbMatchFeeType IS NULL THEN
		SET strErrorDescribe = N'抱歉,您报名的比赛不存在！';
		SET nRet = 1;
		leave label_pro;	
	END IF;
	
	-- 用户信息
	SELECT IsAndroidUser=IsAndroid,UserMemberOrder=MemberOrder FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID;
	
	-- 用户校验
	IF UserMemberOrder IS NULL THEN
		SET strErrorDescribe = '抱歉,您的用户信息不存在，请联系客服中心！';
		SET nRet = 2;
		leave label_pro;			
	END IF;

	-- 机器过滤
	IF IsAndroidUser=0 THEN
		-- 报名条件
		IF UserMemberOrder<cbMemberOrder THEN
			SET strErrorDescribe = '抱歉,您的等级不够不符合报名条件！';
			SET nRet = 3;
			leave label_pro;
		END IF;

		-- 扣除费用
		IF lMatchFee>0 THEN
			-- 金币支付
			IF cbMatchFeeType=0 THEN
				-- 查询金币
				SELECT Score=Score FROM GameScoreInfo WHERE UserID=dwUserID;
				IF Score IS NULL THEN
					SET strErrorDescribe = '抱歉,没有找到您的金币信息,请您与我们的客服人员联系！';
					SET nRet = 4;
					leave label_pro;
				END IF;

				-- 金币不足
				IF Score < lMatchFee THEN
					SET strErrorDescribe = '抱歉,您身上的金币不足,系统无法为您成功报名！';
					SET nRet = 5;
					leave label_pro;
				END IF;

				-- 更新金币
				UPDATE GameScoreInfo SET Score=Score-lMatchFee WHERE UserID=dwUserID;
			END IF;

			-- 元宝支付
			IF cbMatchFeeType=1 THEN
				-- 查询元宝
				SELECT wUserMedal=UserMedal FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID;
				IF wUserMedal IS NULL THEN
					SET strErrorDescribe = '抱歉,没有找到您的元宝信息,请您与我们的客服人员联系！';
					SET nRet = 4;
					leave label_pro;
				END	IF;

				-- 元宝不足
				IF wUserMedal < lMatchFee THEN
					SET strErrorDescribe = '抱歉,您身上的元宝不足,系统无法为您成功报名！';
					SET nRet = 5;
					leave label_pro;
				END IF;

				-- 更新元宝
				UPDATE QPAccountsDB.AccountsInfo SET UserMedal=wUserMedal-lMatchFee WHERE UserID=dwUserID;
			END IF;
		END IF;
	END IF;

	-- 更新分数
	IF exists(SELECT * FROM MatchScoreInfo WHERE UserID=dwUserID AND ServerID=wServerID AND MatchID=dwMatchID AND MatchNo=dwMatchNo) THEN
		UPDATE MatchScoreInfo SET Score=InitialScore,WinCount=0,LostCount=0,DrawCount=0,FleeCount=0,PlayTimeCount=0,OnlineTime=0,
		UserRight=0x10000000,SignupTime=NOW()
		WHERE UserID=dwUserID AND ServerID=wServerID AND MatchID=dwMatchID AND MatchNo=dwMatchNo;
	ELSE
		VALUES (dwUserID,wServerID,dwMatchID,dwMatchNo,InitialScore,0x10000000);	
	END	IF;

	-- 插入记录	
	IF IsAndroidUser=0 THEN
		INSERT StreamMatchFeeInfo (UserID,ServerID,MatchID,MatchNo,MatchType,MatchFeeType,MatchFee,CollectDate) 
		VALUES(dwUserID,wServerID,dwMatchID,dwMatchNo,1,cbMatchFeeType,lMatchFee,NOW());
	END IF;

	-- 查询金币
	SELECT CurrScore=Score FROM GameScoreInfo WHERE UserID=dwUserID;	
	
	-- 查询元宝
	SELECT CurrIngot=UserMedal FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID;
	
	-- 调整数据
	IF CurrScore IS NULL THEN
		SET CurrScore=0;
	END IF;
	IF CurrIngot IS NULL THEN
		SET CurrIngot=0;
	END IF;

	-- 抛出数据
	SELECT 	CurrScore AS Score,CurrIngot AS Ingot;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GSP_GR_UserMatchQuit`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GSP_GR_UserMatchQuit`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GSP_GR_UserMatchQuit`(dwUserID INT,								-- 用户 I D
	lMatchFee BIGINT,							-- 报名费用
	wKindID INT,								-- 游戏 I D
	wServerID INT,								-- 房间 I D
	strClientIP NVARCHAR(15),					-- 连接地址
	dwMatchID	INT,							-- 比赛 I D
	dwMatchNo	INT,							-- 比赛场次
	strMachineID NVARCHAR(32),				-- 机器标识
	OUT strErrorDescribe NVARCHAR(127),		-- 输出信息
	OUT nRet INT)
label_pro:BEGIN
	-- 比赛信息
	DECLARE cbMatchFeeType TINYINT;
	
	-- 用户信息
	DECLARE IsAndroidUser TINYINT;
	
	-- 查询金币
	DECLARE Score BIGINT;
	
	-- 查询元宝
	DECLARE UserMedal BIGINT;

	-- 查询金币
	DECLARE CurrScore BIGINT;
	
	-- 查询元宝
	DECLARE CurrIngot BIGINT;
	
	SELECT cbMatchFeeType=MatchFeeType FROM qpplatformdb.MatchPublic WHERE MatchID=dwMatchID;
	IF cbMatchFeeType IS NULL THEN
		SET strErrorDescribe = '抱歉,您报名的比赛不存在！';
		SET nRet = 1;
		leave label_pro;
	END IF;

	-- 用户信息
	SELECT IsAndroidUser=IsAndroid FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID;

	-- 存在判断
	IF IsAndroidUser IS NULL THEN
		SET strErrorDescribe = '抱歉,您的用户信息不存在！';
		SET nRet = 2;
		leave label_pro;
	END IF;

	-- 返还费用
	IF IsAndroidUser=0 AND lMatchFee>0 THEN
		-- 金币支付
		IF cbMatchFeeType=0 THEN
			-- 查询金币
			SELECT Score=Score FROM GameScoreInfo WHERE UserID=dwUserID;
			IF Score IS NULL THEN
				SET strErrorDescribe = '没有找到您的金币信息,请您与我们的客服人员联系！';
				SET nRet = 3;
				leave label_pro;					
			END IF;

			-- 更新金币
			UPDATE GameScoreInfo SET Score=Score+lMatchFee WHERE UserID=dwUserID;
		END IF;

		-- 奖牌支付
		IF cbMatchFeeType=1 THEN
			-- 查询元宝
			SELECT UserMedal=UserMedal FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID;
			IF UserMedal IS NULL THEN
				SET strErrorDescribe = '没有找到您的元宝信息,请您与我们的客服人员联系！';
				SET nRet = 4;
				leave label_pro;
			END	IF;

			-- 更新元宝
			UPDATE QPAccountsDB.AccountsInfo SET UserMedal=UserMedal+lMatchFee WHERE UserID=dwUserID;
		END IF;	
	END IF;

	-- 删除记录
	IF IsAndroidUser=0 THEN
		DELETE FROM StreamMatchFeeInfo WHERE UserID=dwUserID AND ServerID=wServerID AND MatchID=dwMatchID AND MatchNo=dwMatchNo;
	END IF;

	-- 查询金币
	SELECT CurrScore=Score FROM GameScoreInfo WHERE UserID=dwUserID;
	
	-- 查询元宝
	SELECT CurrIngot=UserMedal FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID;

	-- 调整数据
	IF CurrScore IS NULL THEN
		SET CurrScore=0;
	END IF;
	
	IF CurrIngot IS NULL THEN
		SET CurrIngot=0;
	END IF;

	-- 抛出数据
	SELECT 	CurrScore AS Score,CurrIngot AS Ingot;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GSP_GR_UserSaveScore`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GSP_GR_UserSaveScore`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GSP_GR_UserSaveScore`(dwUserID INT,								-- 用户 I D
	lSaveScore BIGINT,							-- 金币数目
	wKindID SMALLINT,							-- 游戏 I D
	wServerID SMALLINT,						-- 房间 I D
	strClientIP NVARCHAR(15),					-- 连接地址
	strMachineID NVARCHAR(32),					-- 机器标识
	OUT strErrorDescribe NVARCHAR(127),		-- 输出信息
	OUT nRet INT)
label_pro:BEGIN
	-- 金币变量
	DECLARE SourceScore BIGINT;
	DECLARE SourceInsure BIGINT;
	DECLARE InsureRevenue BIGINT;
	DECLARE VariationScore BIGINT;
	DECLARE VariationInsure BIGINT;

	-- 辅助变量
	DECLARE nEnjoinLogon INT;
	DECLARE EnjoinInsure INT;

	-- 查询用户
	DECLARE nUserID INT;
	DECLARE nNullity BIT;
	DECLARE nStunDown BIT;
	DECLARE	strMachineID NVARCHAR(32);
	DECLARE cbMoorMachine TINYINT;
	
	-- 金币判断
	DECLARE BankPrerequisite INT;

	-- 查询锁定
	DECLARE LockKindID INT;
	DECLARE LockServerID INT;

	-- 查询信息
	DECLARE strKindName NVARCHAR(31);
	DECLARE strServerName NVARCHAR(31);
	
	-- 系统暂停
	SELECT StatusValue INTO EnjoinInsure FROM QPAccountsDB.SystemStatusInfo WHERE StatusName='EnjoinInsure';
	IF EnjoinInsure IS NOT NULL AND EnjoinInsure<>0 THEN
		SELECT strErrorDescribe=StatusString FROM QPAccountsDB.SystemStatusInfo WHERE StatusName='EnjoinInsure';
		SET nRet = 2;
		leave label_pro;
	END IF;

	-- 效验地址
	SELECT EnjoinLogon INTO nEnjoinLogon FROM ConfineAddress WHERE AddrString=strClientIP AND NOW()<EnjoinOverDate;
	IF nEnjoinLogon IS NOT NULL AND nEnjoinLogon<>0 THEN
		SET strErrorDescribe='抱歉地通知您，系统禁止了您所在的 IP 地址的游戏服务权限，请联系客户服务中心了解详细情况！';
		SET nRet = 4;
		leave label_pro;
	END IF;
	
	-- 效验机器
	SELECT EnjoinLogon INTO nEnjoinLogon FROM ConfineMachine WHERE MachineSerial=strMachineID AND NOW()<EnjoinOverDate;
	IF EnjoinLogon IS NOT NULL AND EnjoinLogon<>0 THEN
		SET strErrorDescribe='抱歉地通知您，系统禁止了您的机器的游戏服务权限，请联系客户服务中心了解详细情况！';
		SET nRet = 7;
		leave label_pro;
	END IF;
 
	-- 查询用户
	SELECT UserID, Nullity, StunDown, MoorMachine, LastLogonMachine INTO nUserID,nNullity,nStunDown,cbMoorMachine,strMachineID
	FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID;

	-- 查询用户
	IF nUserID IS NULL THEN
		SET strErrorDescribe='您的帐号不存在或者密码输入有误，请查证后再次尝试登录！';
		SET nRet = 1;
		leave label_pro;
	END	IF;

	-- 帐号禁止
	IF nNullity<>0 THEN
		SET strErrorDescribe='您的帐号暂时处于冻结状态，请联系客户服务中心了解详细情况！';
		SET nRet = 2;
		leave label_pro;
	END IF;

	-- 帐号关闭
	IF nStunDown<>0 THEN
		SET strErrorDescribe='您的帐号使用了安全关闭功能，必须重新开通后才能继续使用！';
		SET nRet = 3;
		leave label_pro;
	END IF;
	
	-- 固定机器
	IF cbMoorMachine=1 THEN
		IF MachineID<>strMachineID THEN
			SET strErrorDescribe='您的帐号使用固定机器登录功能，您现所使用的机器不是所指定的机器！';
			SET nRet = 1;
			leave label_pro;
		END IF;
	END IF;
	
	-- 金币判断
	SELECT StatusValue INTO BankPrerequisite FROM QPAccountsDB.SystemStatusInfo WHERE StatusName='BankPrerequisite';
	IF BankPrerequisite IS NULL THEN
		SET BankPrerequisite=0;
	END IF;

	IF lSaveScore<BankPrerequisite THEN
		SET strErrorDescribe=CONCAT('存入银行的游戏币数目不能少于 ', LTRIM(STR(BankPrerequisite)), '，游戏币存入失败！');
		SET nRet = 4;
		leave label_pro;
	END IF;

	-- 开始事务
	START TRANSACTION;

	-- 游戏信息
	SELECT Score, InsureScore INTO SourceScore,SourceInsure FROM GameScoreInfo WHERE UserID=dwUserID;

	-- 金币判断
	IF SourceScore IS NULL OR SourceScore<lSaveScore THEN
		-- 结束事务
		ROLLBACK;
		START TRANSACTION;

		-- 错误信息
		SET strErrorDescribe='您当前游戏币的可用余额不足，游戏币存入失败！';
		SET nRet = 4;
		leave label_pro;
	END IF;

	-- 查询锁定
	SELECT KindID, ServerID INTO LockKindID,LockServerID FROM GameScoreLocker WHERE UserID=dwUserID;

	-- 锁定调整
	IF LockKindID IS NULL THEN
		SET LockKindID=0;
	END IF;

	IF LockServerID IS NULL THEN
		SET LockServerID=0;
	END IF;

	-- 锁定判断
	IF (LockKindID<>0 and LockKindID<>wKindID) OR (LockServerID<>0 and LockServerID<>wServerID) THEN
		-- 结束事务
		ROLLBACK;
		START TRANSACTION;

		-- 查询类型
		IF LockKindID<>0 AND LockServerID<>0 THEN
			-- 查询信息
			SELECT KindName INTO strKindName FROM QPPlatformDB.GameKindItem WHERE KindID=LockKindID;
			SELECT ServerName INTO strServerName FROM QPPlatformDB.GameRoomInfo WHERE ServerID=LockServerID;

			-- 错误信息
			IF strKindName IS NULL THEN
				SET strKindName='未知游戏';
			END IF;
			
			IF strServerName IS NULL THEN
				SET strServerName='未知房间';
			END IF;
			
			SET strErrorDescribe=CONCAT('您正在 [ ', strKindName, ' ] 的 [ ', strServerName, ' ] 游戏房间中，不能进行当前的银行操作！');
			SET nRet = 4;
			leave label_pro;

		ELSE
			-- 提示消息
			SELECT ErrorDescribe='您正在使用网站页面进行银行处理过程中，不能进行当前的银行操作！';
			SET strErrorDescribe='您正在使用网站页面进行银行处理过程中，不能进行当前的银行操作！';
			SET nRet = 4;
			leave label_pro;
		END IF;
	END IF;

	-- 计算变量
	SET InsureRevenue=0;
	SET VariationScore=-lSaveScore;
	SET VariationInsure=lSaveScore;

	-- 设置信息
	SET strErrorDescribe='游戏币存入银行操作成功，请查验您的帐户信息！';

	-- 更新数据
	UPDATE GameScoreInfo SET Score=Score+VariationScore, InsureScore=InsureScore+VariationInsure, Revenue=Revenue+InsureRevenue	
	WHERE UserID=dwUserID;

	-- 记录日志
		SwapScore,Revenue,IsGamePlaza,TradeType,ClientIP)
	VALUES(wKindID,wServerID,UserID,SourceScore,SourceInsure,lSaveScore,InsureRevenue,0,1,strClientIP);

	-- 结束事务
	COMMIT;

	-- 输出结果
	SELECT dwUserID AS UserID, SourceScore AS SourceScore, SourceInsure AS SourceInsure, VariationScore AS VariationScore,
		VariationInsure AS VariationInsure, InsureRevenue AS InsureRevenue, LockKindID AS KindID, LockServerID AS ServerID;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GSP_GR_UserTakeScore`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GSP_GR_UserTakeScore`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GSP_GR_UserTakeScore`(
	dwUserID INT,								-- 用户 I D
	lTakeScore BIGINT,							-- 金币数目
	strPassword NCHAR(32),						-- 用户密码
	wKindID SMALLINT,							-- 游戏 I D
	wServerID SMALLINT,						-- 房间 I D
	strClientIP NVARCHAR(15),					-- 连接地址
	strMachineID NVARCHAR(32),					-- 机器标识
	OUT strErrorDescribe NVARCHAR(127),		-- 输出信息
	OUT nRet INT
)
label_pro:BEGIN
	-- 金币变量
	DECLARE SourceScore BIGINT;
	DECLARE SourceInsure BIGINT;
	DECLARE InsureRevenue BIGINT;
	DECLARE VariationScore BIGINT;
	DECLARE VariationInsure BIGINT;

	-- 查询用户
	DECLARE UserID INT;
	DECLARE Nullity BIT;
	DECLARE StunDown BIT;
	DECLARE InsurePass NCHAR(32);
	DECLARE	MachineID NVARCHAR(32);
	DECLARE MoorMachine TINYINT;

	-- 查询锁定
	DECLARE LockKindID INT;
	DECLARE LockServerID INT;

	-- 辅助变量
	DECLARE EnjoinLogon INT;
	DECLARE EnjoinInsure INT;
	
	-- 金币判断
	DECLARE BankPrerequisite INT;

	-- 银行税收
	DECLARE RevenueRate INT;
	
	-- 系统暂停
	SELECT EnjoinInsure=StatusValue FROM QPAccountsDB.SystemStatusInfo WHERE StatusName='EnjoinInsure';
	IF EnjoinInsure IS NOT NULL AND EnjoinInsure<>0 THEN
		SELECT strErrorDescribe=StatusString FROM QPAccountsDB.SystemStatusInfo WHERE StatusName='EnjoinInsure';
		SET nRet = 2;
		leave label_pro;
	END IF;

	-- 效验地址
	SELECT EnjoinLogon=EnjoinLogon FROM ConfineAddress WHERE AddrString=strClientIP AND NOW()<EnjoinOverDate;
	IF EnjoinLogon IS NOT NULL AND EnjoinLogon<>0 THEN
		SET strErrorDescribe='抱歉地通知您，系统禁止了您所在的 IP 地址的游戏服务权限，请联系客户服务中心了解详细情况！';
		SET nRet = 4;
		leave label_pro;
	END IF;
	
	-- 效验机器
	SELECT EnjoinLogon=EnjoinLogon FROM ConfineMachine WHERE MachineSerial=strMachineID AND NOW()<EnjoinOverDate;
	IF EnjoinLogon IS NOT NULL AND EnjoinLogon<>0 THEN
		SET strErrorDescribe='抱歉地通知您，系统禁止了您的机器的游戏服务权限，请联系客户服务中心了解详细情况！';
		SET nRet = 7;
		leave label_pro;
	END IF;
 
	-- 查询用户
	SELECT UserID=UserID, InsurePass=InsurePass, Nullity=Nullity, StunDown=StunDown, MoorMachine=MoorMachine, MachineID=LastLogonMachine
	FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID;

	-- 查询用户
	IF UserID IS NULL THEN
		SET strErrorDescribe='您的帐号不存在或者密码输入有误，请查证后再次尝试登录！';
		SET nRet = 1;
		leave label_pro;
	END	IF;

	-- 帐号禁止
	IF Nullity<>0 THEN
		SET strErrorDescribe='您的帐号暂时处于冻结状态，请联系客户服务中心了解详细情况！';
		SET nRet = 2;
		leave label_pro;
	END IF;

	-- 帐号关闭
	IF StunDown<>0 THEN
		SET strErrorDescribe='您的帐号使用了安全关闭功能，必须重新开通后才能继续使用！';
		SET nRet = 2;
		leave label_pro;
	END IF;
	
	-- 固定机器
	IF MoorMachine=1 THEN
		IF MachineID<>strMachineID THEN
			SET strErrorDescribe='您的帐号使用固定机器登录功能，您现所使用的机器不是所指定的机器！';
			SET nRet = 1;
			leave label_pro;
		END IF;
	END IF;

	-- 密码判断
	IF InsurePass<>strPassword THEN
		SET strErrorDescribe='您的银行密码不正确或者输入有误，请查证后再次尝试！';
		SET nRet = 3;
		leave label_pro;
	END IF;

	-- 金币判断
	SELECT BankPrerequisite=StatusValue FROM QPAccountsDB.SystemStatusInfo WHERE StatusName='BankPrerequisite';
	IF BankPrerequisite IS NULL THEN
		SET BankPrerequisite=0;
	END IF;

	IF lTakeScore<BankPrerequisite THEN
		SET strErrorDescribe='从银行取出的游戏币数目不能少于 '+LTRIM(STR(BankPrerequisite))+'，游戏币提取失败！';
		SET nRet = 4;
		leave label_pro;
	END IF;

	-- 银行税收
	SELECT RevenueRate=StatusValue FROM QPAccountsDB.SystemStatusInfo WHERE StatusName='RevenueRateTake';

	-- 税收调整
	IF RevenueRate>300 THEN
		SET RevenueRate=300;
	END IF;
	
	IF RevenueRate IS NULL THEN
		SET RevenueRate=1;
	END IF;

	-- 开始事务
	START TRANSACTION;

	-- 游戏信息
	SELECT SourceScore=Score, SourceInsure=InsureScore FROM GameScoreInfo WHERE UserID=dwUserID;

	-- 金币判断
	IF SourceInsure IS NULL OR SourceInsure<lTakeScore THEN
		-- 结束事务
		ROLLBACK;
		START TRANSACTION;

		-- 错误信息
		SET strErrorDescribe='您当前银行的游戏币余额不足，游戏币提取失败！';
		SET nRet = 4;
		leave label_pro;
	END IF;

	-- 查询锁定
	SELECT LockKindID=KindID, LockServerID=ServerID FROM GameScoreLocker WHERE UserID=dwUserID;

	-- 计算变量
	SET InsureRevenue=lTakeScore*RevenueRate/1000;
	SET VariationScore=lTakeScore-InsureRevenue;
	SET VariationInsure=-lTakeScore;

	-- 设置信息
	SET strErrorDescribe='银行提取游戏币操作成功，请查验您的帐户信息！';

	-- 更新数据
	UPDATE GameScoreInfo SET Score=Score+VariationScore, InsureScore=InsureScore+VariationInsure, Revenue=Revenue+InsureRevenue
	WHERE UserID=dwUserID;

	-- 记录日志
		SwapScore,Revenue,IsGamePlaza,TradeType,ClientIP)
	VALUES(wKindID,wServerID,UserID,SourceScore,SourceInsure,lTakeScore,InsureRevenue,0,2,strClientIP);

	-- 结束事务
	COMMIT;

	-- 输出结果
	SELECT dwUserID AS UserID, SourceScore AS SourceScore, SourceInsure AS SourceInsure, VariationScore AS VariationScore,
		VariationInsure AS VariationInsure, InsureRevenue AS InsureRevenue, LockKindID AS KindID, LockServerID AS ServerID;

END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GSP_GR_WriteEMail`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GSP_GR_WriteEMail`;
DELIMITER ;;
CREATE DEFINER=`root`@`%` PROCEDURE `GSP_GR_WriteEMail`(dwUserID INT, 						-- 用户ID
	
	cbType tinyint,						-- 邮件类型
	createTime timestamp,			-- 创建时间
	szRewardProp NVARCHAR(256),		-- 奖励道具
	szEmailTitle NVARCHAR(100), -- 邮件标题
	szEmailMsg NVARCHAR(320),	-- 邮件内容
	
	OUT strErrorDescribe NVARCHAR(127),-- 输出信息
	OUT nRet INT)
label_pro:BEGIN

	-- 查询用户
	IF not exists(SELECT UserID FROM QPAccountsDB.AccountsInfo WHERE UserID=dwUserID) THEN
	
		SET strErrorDescribe = '抱歉，你的用户信息不存在或者密码不正确！';
		SET nRet = 1;
		LEAVE label_pro;
	END IF;

	-- 救济金发放更新
	UPDATE QPAccountsDB.AccountsInfo set BenefitTimes = BenefitTimes+1, LastBenefitTime = createTime where UserID = dwUserID;

	-- 插入邮件
	VALUES(dwUserID,szEmailTitle,szEmailMsg,szRewardProp,cbType,createTime);
	
	SELECT UserID, BenefitTimes, LastBenefitTime FROM QPAccountsDB.AccountsInfo WHERE UserID = dwUserID;
END
;;
DELIMITER ;

-- ----------------------------
-- Procedure structure for `GSP_GR_WriteGameScore`
-- ----------------------------
DROP PROCEDURE IF EXISTS `GSP_GR_WriteGameScore`;
DELIMITER ;;
CREATE DEFINER=`root`@`localhost` PROCEDURE `GSP_GR_WriteGameScore`(dwUserID INT,								-- 用户 I D
	dwDBQuestID INT,							-- 请求标识
	dwInoutIndex INT,							-- 进出索引

	-- 变更成绩
	lVariationScore BIGINT,					-- 用户分数
	lVariationGrade BIGINT,					-- 用户成绩
	lVariationInsure BIGINT,					-- 用户银行
	lVariationRevenue BIGINT,					-- 游戏税收
	lVariationWinCount INT,					-- 胜利盘数
	lVariationLostCount INT,					-- 失败盘数
	lVariationDrawCount INT,					-- 和局盘数
	lVariationFleeCount INT,					-- 逃跑数目
	lVariationUserMedal INT,					-- 用户奖牌
	lVariationExperience INT,					-- 用户经验
	lVariationLoveLiness INT,					-- 用户魅力
	dwVariationPlayTimeCount INT,				-- 游戏时间

	-- 附加信息
	cbTaskForward TINYINT,						-- 任务跟进

	-- 属性信息	
	wKindID INT,								-- 游戏 I D
	wServerID INT,								-- 房间 I D
	strClientIP NVARCHAR(15))
BEGIN
	-- 变更记录
	DECLARE DateID INT;

	-- 用户积分
	UPDATE GameScoreInfo SET Score=Score+lVariationScore, Revenue=Revenue+lVariationRevenue, InsureScore=InsureScore+lVariationInsure,
		WinCount=WinCount+lVariationWinCount, LostCount=LostCount+lVariationLostCount, DrawCount=DrawCount+lVariationDrawCount,
		FleeCount=FleeCount+lVariationFleeCount, PlayTimeCount=PlayTimeCount+dwVariationPlayTimeCount
	WHERE UserID=dwUserID;

	-- 全局信息
	IF lVariationExperience>0 OR lVariationLoveLiness<>0 OR lVariationUserMedal>0 THEN
		UPDATE QPAccountsDB.AccountsInfo SET Experience=Experience+lVariationExperience, LoveLiness=LoveLiness+lVariationLoveLiness 
		WHERE UserID=dwUserID;
	END IF;

	-- 变更记录
    SET DateID=UNIX_TIMESTAMP(NOW());
	
	-- 存在判断
	IF NOT EXISTS(SELECT * FROM StreamScoreInfo WHERE DateID=DateID AND UserID=dwUserID) THEN
		-- 插入记录
		VALUES(DateID, dwUserID, lVariationWinCount, lVariationLostCount, lVariationRevenue, dwVariationPlayTimeCount, 0, NOW(), NOW());
	ELSE
		-- 更新记录
		UPDATE StreamScoreInfo SET WinCount=WinCount+lVariationWinCount, LostCount=LostCount+lVariationLostCount, Revenue=Revenue+lVariationRevenue,
			   PlayTimeCount=PlayTimeCount+dwVariationPlayTimeCount, LastCollectDate=NOW()
		WHERE DateID=DateID AND UserID=dwUserID;
	END IF;
		
	-- 任务跟进
	-- IF cbTaskForward=1 THEN
	-- 	call QPPlatformDB.GSP_GR_TaskForward(dwUserID,wKindID,0,lVariationWinCount,lVariationLostCount,lVariationDrawCount);
	-- END IF;
END
;;
DELIMITER ;
